met Paul Walker, Laurence Fishburne en Jason Lewis

Tim Kearney is een ex-marinier die in de gevangenis is beland. Hij krijgt een deal aangeboden door DEA-agent Tad Gruzsa, 
waardoor hij vervroegd vrij kan komen. De deal houdt in dat Kearney zich moet voordoen als de zojuist overleden drugsdealer 
Bobby Z en in een gijzelaarsruil wordt betrokken met een grote crimineel. Het plannetje valt echter in het water en Kearney 
moet op de vlucht slaan met Z's 11-jarige zoontje.
